infoparam.value:
Apply Alpha
The input and output satisfy a difference equation of the form y[n] - (1-alpha) y[n-1] = alpha x[n]
with the corresponding rational system function H(z) = frac{alpha}{1 - (1-alpha) z^{-1}}
for each output, for the entire input vector output = alpha * input + one_minus_alpha * prev_output;
Filter detais see: /gr-filter/include/gnuradio/filter/single_pole_iir.h

